a=input()
b=input()
n=len(a)
m=len(b)
cnt=0
l=[]
for i in range(n):
	if a[i]!=b[i]:
		cnt+=1
	else:
		l.append(cnt)
if cnt==0:
	print(-1)
else:
	ans=[]
	for i in range(m):
		ans.append(l[i])
	for i in range(n-1,-1,-1):
		ans.append(l[i])
	z=0
	for i in range(len(ans)):
		if ans[i]!=0:
			z+=1
	if z==m:
		print(-1)
	else:
		print(ans[i])
